import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import 'components/SetlistResult/SetlistResult.css';

const setlistResult = (props) => {
        return(
            <Row>
                <Col md={{ span: 8, offset: 2 }} className="setlistResult">
                    <Row>
                        <Col md={{ span: 2 }}>
                        <div className="dateBlock">
                            <span className="month">Jan</span>
                            <span className="day">1</span>
                            <span className="year">2020</span>
                        </div>
                    </Col>

                    <Col md={{ span: 10 }}>
                        <span className="artistName">Local Natives</span>
                    <div>The Drake Hotel, Toronto, Canada</div>
                    <div>10 songs</div>
                    </Col>
                    </Row>

                </Col>
            </Row>
        )
}

export default setlistResult;
